import "dart:html";
import "dart:convert";
import "dart:async";
import "package:markov/markov.dart";
import "dart:math";

MarkovChain chain;
Random rng;
Element choice1, choice2, choice1p, choice2p;
int realLoc;
int numCorrect;
int numDone;

main() async {
  print("Loading tweets and generating markov chain");
  rng = new Random();
  choice1 = querySelector("#choice-1");
  choice2 = querySelector("#choice-2");
  choice1p = querySelector("#choice-1-text");
  choice2p = querySelector("#choice-2-text");
  choice1.onClick.listen(onChoice1Clicked);
  choice2.onClick.listen(onChoice2Clicked);
  realLoc = 0;
  numCorrect = 0;
  numDone = 0;

  chain = await Stream.fromIterable(tweets)
              .pipe(new MarkovChainGenerator(5));
  
  generateChoices();
}

void onChoice1Clicked(MouseEvent e) {
  numDone++;
  if (realLoc == 1) {
    numCorrect++;
  }
  
  print("Num done: " + numDone.toString());
  print("Num correct: " + numCorrect.toString());
  //print("Percent correct: " + (String) (100.0 * (numCorrect / numDone)));

  generateChoices();
}

void onChoice2Clicked(MouseEvent e) {
  numDone++;
  if (realLoc == 2) {
    numCorrect++;
  }

  print("Num done: " + numDone.toString());
  print("Num correct: " + numCorrect.toString());
  //print("Percent correct: " + (String) (100.0 * (numCorrect / numDone)));

  generateChoices();
}

void generateChoices() {
  String generatedTweet = getFakeTweet();
  String realTweet = getRealTweet();
  if (rng.nextBool()) {
    choice1p.text = generatedTweet;
    choice2p.text = realTweet;
    realLoc = 2;
  } else {
    choice1p.text = realTweet;
    choice2p.text = generatedTweet;
    realLoc = 1;
  }
}

String getRealTweet() {
  return tweets[rng.nextInt(tweets.length)];
}

String getFakeTweet() {
  return format(chain.generate().takeWhile((token) => token.string != "\n").toList());
}

